(1, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '¿Qué es lo que debes incluir en una publicación en el blog? Contenido útil, específico a la industria, que: 1) ofrece información práctica a los lectores, y 2) demuestra que eres un experto de la industria. \n\nUsa las publicaciones en el blog de tu empresa para opinar sobre temas actuales de la industria, humaniza a tu empresa y demuestra cómo tus productos y servicios pueden ayudar a las personas.Use your company\'s blog posts to opine on current industry topics, humanize your company, and show how your products and services can help people.', 'Título de la publicación en el blog', '', 'publish', 'open', 'open', '', 'titulo-de-la-publicacion-en-el-blog', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 0, 'http://times.com.ar/times/?p=1', 0, 'post', '', 1),
(2, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55141317562\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55141317562\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"60.00\",\"coblocks\":{\"id\":\"55141320246\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55141320246\" style=\"width:60.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:image {\"id\":410} -->\n<figure class=\"wp-block-image\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/09/i8-e1568406947840.jpg\" alt=\"\" class=\"wp-image-410\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Nuestra Filosofía</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Estar siempre al lado del cliente, asesorandolo y guiandolo para encontrar el producto que mejor se adapte a su necesidad, realizando los ajustes que él requiera en el momento que lo necesite</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"39.00\",\"coblocks\":{\"id\":\"55141320249\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55141320249\" style=\"width:39.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":3} -->\n<h3>Nuestra historia</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Desde 1992 estamos en la ciudad de Campana, siendo siempre innovadores, empezamos como centro de capacitación en las herramientas que aun pocos conocían como Windows, Word, Excel, y fuimos creciendo involucrandonos cada vez mas en las herramientas que las empresas y personas necesitaban, por tal motivo armamos un pool de programadores  y seguimos avanzando en este mundo maravilloso de la programacion que nos permite crear aplicaciones cada vez mas agiles y dinamicas.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->', 'La Empresa', '', 'publish', 'closed', 'closed', '', 'la-empresa', '', '', '2019-10-11 09:24:14', '2019-10-11 12:24:14', '', 0, 'http://times.com.ar/times/?page_id=2', 0, 'page', '', 0),
