ing -->\n\n<!-- wp:paragraph -->\n<p>Aquí puedes contarles a los potenciales clientes más sobre tu empresa, y sobre los servicios que ofreces.. &nbsp;Reemplaza esta imagen con una más apropiada para tu empresa.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:spacer {\"height\":27} -->\n<div style=\"height:27px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Siguientes pasos...</h3>\n<!-- /wp:heading -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph -->\n<p>Esta debe ser la llamada de acción número uno de un potencial cliente, por ejemplo, solicitar una cotización o analizar el catálogo de tus productos.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:button {\"align\":\"center\"} -->\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\" href=\"/comunicate-con-nosotros/\">Llamada a la acción</a></div>\n<!-- /wp:button --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->', 'Servicios', '', 'inherit', 'closed', 'closed', '', '158-revision-v1', '', '', '2019-09-11 18:11:15', '2019-09-11 21:11:15', '', 158, 'http://ti