(318, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '¿Qué es lo que debes incluir en una publicación en el blog? Contenido útil, específico a la industria, que: 1) ofrece información práctica a los lectores, y 2) demuestra que eres un experto de la industria. \n\nUsa las publicaciones en el blog de tu empresa para opinar sobre temas actuales de la industria, humaniza a tu empresa y demuestra cómo tus productos y servicios pueden ayudar a las personas.Use your company\'s blog posts to opine on current industry topics, humanize your company, and show how your products and services can help people.', 'Título de la publicación en el blog', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 1, 'http://times.com.ar/times/1-revision-v1/', 0, 'revision', '', 0),
(319, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55141317562\"}} --><div class=\"coblocks-row-55141317562 wp-block-coblocks-row\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"has-no-margin has-no-padding has-medium-gutter is-stacked-on-mobile wp-block-coblocks-row__inner\"><!-- wp:coblocks/column {\"width\":\"60.00\",\"coblocks\":{\"id\":\"55141320246\"}} --><div class=\"wp-block-coblocks-column coblocks-column-55141320246\" style=\"width:60.00%\"><div class=\"has-no-margin has-no-padding wp-block-coblocks-column__inner\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-1.jpg\"></figure><!-- /wp:image --></div></div><!-- /wp:coblocks/column --><!-- wp:coblocks/column {\"width\":\"39.00\",\"coblocks\":{\"id\":\"55141320249\"}} --><div class=\"wp-block-coblocks-column coblocks-column-55141320249\" style=\"width:39.00%\"><div class=\"has-no-margin has-no-padding wp-block-coblocks-column__inner\"><!-- wp:heading {\"level\":3} --><h3>Nuestro enfoque</h3><!-- /wp:heading --><!-- wp:paragraph --><p>También podrías definir este encabezado como \"Nuestra filosofía\" o \"Nuestra visión\". Aquí es donde puedes hablar sobre lo que te apasiona a ti y lo que impulsa a tu empresa, y sobre lo que es único acerca de tu proceso. Lo que escribas aquí debiera ser algo singular e interesante sobre tu empresa que lo distingue de las demás de la misma industria.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Nuestra historia</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Toda empresa tiene un comienzo, y aquí es donde puedes conversar sobre el tuyo. La gente quiere saber de qué oportunidad te diste cuenta o cómo tu pasión te condujo a la creación de algo nuevo. Habla acerca de tus raíces--la gente quiere saber que las tienes.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/column --></div></div><!-- /wp:coblocks/row --><!-- wp:spacer {\"height\":63} --><div class=\"wp-block-spacer\" style=\"height:63px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:heading {\"level\":3,\"align\":\"center\"} --><h3 style=\"text-align:center\">Conoce al equipo</h3><!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\">Escribe algo acerca de las personas que hacen funcionar tu empresa o sobre tu filosofía de servicio al cliente.\n¿Por qué? Porque la gente quiere saber con quiénes están haciendo sus negocios. Es una característica muy humana.</p><!-- /wp:paragraph --><!-- wp:columns {\"columns\":3} --><div class=\"has-3-columns wp-block-columns\"><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-1.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3,\"align\":\"center\"} --><h3 style=\"text-align:center\">Regan McCook</h3><!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\"><em>Fundador y director ejecutivo</em></p><!-- /wp:paragraph --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p><!-- /wp:paragraph --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-2.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3,\"align\":\"center\"} --><h3 style=\"text-align:center\">Eric Teagan</h3><!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\"><em>Vicepresidente</em></p><!-- /wp:paragraph --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p><!-- /wp:paragraph --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-3.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3,\"align\":\"center\"} --><h3 style=\"text-align:center\">Timothy Barrett</h3><!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\"><em>Director financiero</em></p><!-- /wp:paragraph --><!-- wp:paragraph {\"align\":\"center\"} --><p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p><!-- /wp:paragraph --></div><!-- /wp:column --></div><!-- /wp:columns --><!-- wp:spacer {\"height\":27} --><div class=\"wp-block-spacer\" style=\"height:27px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:heading {\"level\":3} --><h3>Siguientes pasos...</h3><!-- /wp:heading --><!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} --><div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph --><p>Esta debe ser la llamada de acción número uno de un potencial cliente, por ejemplo, solicitar una cotización o analizar el catálogo de tus productos.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/column --><!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:button {\"align\":\"center\"} --><div class=\"wp-block-button aligncenter\"><a href=\"/comunicate-con-nosotros/\" class=\"wp-block-button__link\">Llamada a la acción</a></div><!-- /wp:button --></div></div><!-- /wp:coblocks/column --></div></div><!-- /wp:coblocks/row -->', 'La empresa', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 2, 'http://times.com.ar/times/2-revision-v1/', 0, 'revision', '', 0),
(320, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '<!-- wp:paragraph --><p>Comunícate con nosotros y nos pondremos en contacto contigo tan pronto como nos sea posible.  ¡Esperamos tener noticias tuyas!</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Formulario de contacto</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Los campos marcados con * son obligatorios</p><!-- /wp:paragraph --><!-- wp:spacer {\"height\":20} --><div class=\"wp-block-spacer\" style=\"height:20px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"551462210\"}} --><div class=\"coblocks-row-551462210 wp-block-coblocks-row\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"has-no-margin has-no-padding has-medium-gutter is-stacked-on-mobile wp-block-coblocks-row__inner\"><!-- wp:coblocks/column {\"width\":\"60.00\",\"coblocks\":{\"id\":\"5514624728\"}} --><div class=\"wp-block-coblocks-column coblocks-column-5514624728\" style=\"width:60.00%\"><div class=\"has-no-margin has-no-padding wp-block-coblocks-column__inner\"><!-- wp:coblocks/form --><!-- wp:coblocks/field-name /--><!-- wp:coblocks/field-email {\"required\":true} /--><!-- wp:coblocks/field-textarea {\"required\":true} /--><!-- /wp:coblocks/form --></div></div><!-- /wp:coblocks/column --><!-- wp:coblocks/column {\"width\":\"39.00\",\"coblocks\":{\"id\":\"5514624733\"}} --><div class=\"wp-block-coblocks-column coblocks-column-5514624733\" style=\"width:39.00%\"><div class=\"has-no-margin has-no-padding wp-block-coblocks-column__inner\"><!-- wp:contact-widgets/contact-block --><div class=\"wp-block-contact-widgets-contact-block\"><ul class=\"fields\"><li class=\"has-label\"><div><strong>Correo electrónico<br></strong><div class=\"contact-email\"><a href=\"mailto:email@yourbusiness.com\">email@yourbusiness.com</a></div></div></li><li class=\"has-label\"><div><strong>Teléfono<br></strong><div class=\"contact-phone\">(555) 555-5555</div></div></li><li class=\"has-label\"><div><strong>Fax<br></strong><div class=\"contact-fax\">(555) 555-5555</div></div></li><li class=\"has-label\"><div><strong>Dirección<br></strong><div class=\"contact-address\">1234 Santa Monica Blvd<br>Beverly Hills, CA 90210</div><div class=\"has-map\"><iframe frameborder=\"0\" src=\"https://www.google.com/maps?q=1234%20Santa%20Monica%20Blvd%20Beverly%20Hills%2C%20CA%2090210&output=embed&hl=%s&z=14\" style=\"width:100%;min-height:205px\"></iframe></div></div></li></ul></div><!-- /wp:contact-widgets/contact-block --></div></div><!-- /wp:coblocks/column --></div></div><!-- /wp:coblocks/row -->', 'Comunícate con nosotros', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 19, 'http://times.com.ar/times/19-revision-v1/', 0, 'revision', '', 0),
(321, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '<!-- wp:columns {\"columns\":3,\"className\":\"is-services\"} --><div class=\"wp-block-columns has-3-columns is-services\"><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/home-1.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3><a href=\"#\">Producto / Servicio N.°1</a></h3><!-- /wp:heading --><!-- wp:paragraph --><p>Lo que hace que tu empresa sea reconocida debe introducirse aquí, ya sea que se trate de salchichas o gorras de béisbol o erradicación de murciélagos vampiros.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p><a href=\"#\">Más información</a></p><!-- /wp:paragraph --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/home-2.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3><a href=\"#\">Producto / Servicio N.°2</a></h3><!-- /wp:heading --><!-- wp:paragraph --><p>¿Qué otro artículo popular vendes o comercializas? Habla sobre el mismo aquí, usando frases positivas y memorables, para que los visitantes sientan que no pueden no conseguirlo.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p><a href=\"#\">Más información</a></p><!-- /wp:paragraph --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image --><figure class=\"wp-block-image\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/home-2.jpg\"></figure><!-- /wp:image --><!-- wp:heading {\"level\":3} --><h3><a href=\"#\">Producto / Servicio N.°3</a></h3><!-- /wp:heading --><!-- wp:paragraph --><p>No pienses en este producto o servicio como el tercero en discordia, piensa en él como el campeón olímpico que se ganó la medalla de bronce entre tus extraordinarios productos/servicios.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p><a href=\"#\">Más información</a></p><!-- /wp:paragraph --></div><!-- /wp:column --></div><!-- /wp:columns --><!-- wp:columns {\"className\":\"is-main-message\"} --><div class=\"wp-block-columns has-2-columns is-main-message\"><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:heading {\"level\":3} --><h3>Tu mensaje principal</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Usa este espacio para decirles a las personas lo que hace tu empresa y por qué y cómo lo hace. ¿Por qué cosas te reconocen? ¿Quién te adora? ¿Cuál es tu mejor ventaja competitiva?</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Incluye todas las cosas que hacen que tu empresa sea única y mejor que la competencia. ¿Tienes un proceso patentado de 13 pasos para la taxidermia que produce los búhos embalsamados con un aspecto más que real? Sin dudas, debes mencionarlo.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Otras cosas buenas para incluir en este texto incluyen: premios ganados, distinciones otorgadas, cantidad de productos vendidos, filosofía de la empresa (cuanto más breve mejor), datos interesantes sobre la historia de la empresa y cualquier cosa que ayude a convencer al lector que sería maravilloso hacer negocios contigo.</p><!-- /wp:paragraph --></div><!-- /wp:column --><!-- wp:column --><div class=\"wp-block-column\"><!-- wp:image {\"align\":\"center\"} --><div class=\"wp-block-image\"><figure class=\"aligncenter\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/home-4.jpg\"></figure></div><!-- /wp:image --></div><!-- /wp:column --></div><!-- /wp:columns --><!-- wp:spacer {\"height\":27} --><div class=\"wp-block-spacer\" style=\"height:27px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:heading {\"level\":3} --><h3>Siguientes pasos...</h3><!-- /wp:heading --><!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} --><div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph --><p>Esta debe ser la llamada de acción número uno de un potencial cliente, por ejemplo, solicitar una cotización o analizar el catálogo de tus productos.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/column --><!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:button {\"align\":\"center\"} --><div class=\"wp-block-button aligncenter\"><a href=\"/comunicate-con-nosotros/\" class=\"wp-block-button__link\">Llamada a la acción</a></div><!-- /wp:button --></div></div><!-- /wp:coblocks/column --></div></div><!-- /wp:coblocks/row -->', 'Inicio', '', 'inherit', 'closed', 'closed', '', '156-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 156, 'http://times.com.ar/times/156-revision-v1/', 0, 'revision', '', 0);
