zas? Habla sobre el mismo aquí, usando frases positivas y memorables, para que los visitantes sientan que no pueden no conseguirlo.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/feature --><!-- wp:coblocks/feature {\"coblocks\":{\"id\":\"5514310463\"}} --><div class=\"wp-block-coblocks-feature coblocks-feature-5514310463\"><div class=\"has-no-padding wp-block-coblocks-feature__inner\"><!-- wp:coblocks/icon {\"icon\":\"volume\",\"iconRand\":false,\"iconSize\":\"large\",\"hasContentAlign\":false,\"backgroundColor\":\"secondary\",\"iconColor\":\"quinary\",\"height\":120,\"width\":120,\"borderRadius\":200,\"padding\":30} --><div class=\"wp-block-coblocks-icon\"><div class=\"has-background has-quinary-color has-secondary-background-color has-text-color wp-block-coblocks-icon__inner\" style=\"height:120px;width:120px;border-radius:200px;padding:30px\"><svg aria-hidden=\"true\" focusable=\"false\" height=\"20\" role=\"img\" viewbox=\"0 0 20 20\" width=\"20\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"m.99267578 6.72328559v6.66666671h4.44444445l5.55555557 5.5555555v-17.77777777l-5.55555557 5.55555556zm7.77777778-.18888889v7.0444444l-2.41111111-2.4111111h-3.14444445v-2.22222219h3.14444445zm7.22222224 3.5222222c0-1.96666664-1.1333334-3.65555553-2.7777778-4.47777775v8.94444445c1.6444444-.8111111 2.7777778-2.5 2.7777778-4.4666667zm-2.7777778-9.74444442v2.28888889c3.2111111.95555555 5.5555556 3.93333333 5.5555556 7.45555553s-2.3444445 6.5-5.5555556 7.4555556v2.2888889c4.4555556-1.0111111 7.7777778-4.9888889 7.7777778-9.7444445 0-4.75555553-3.3222222-8.73333331-7.7777778-9.74444442z\" transform=\"translate(-1)\"></path></svg></div></div><!-- /wp:coblocks/icon --><!-- wp:heading {\"level\":4,\"placeholder\":\"Add feature title...\"} --><h4>Producto / Servicio N.°3</h4><!-- /wp:heading --><!-- wp:paragraph {\"placeholder\":\"Add feature content\"} --><p>No pienses en este producto o servicio como el tercero en discordia, piensa en él como el campeón olímpico que se ganó la medalla de bronce entre tus extraordinarios productos/servicios.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/feature --></div></div><!-- /wp:coblocks/features --><!-- wp:spacer --><div class=\"wp-block-spacer\" style=\"height:100px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:media-text {\"mediaType\":\"image\",\"mediaWidth\":45,\"isStackedOnMobile\":true} --><div class=\"alignwide is-stacked-on-mobile wp-block-media-text\" style=\"grid-template-columns:45% auto\"><figure class=\"wp-block-media-text__media\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/services-1.jpg\"></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":3} --><h3>Habla más acerca de tus productos aquí.</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Aquí puedes contarles a los potenciales clientes más sobre tu empresa, y sobre los servicios que ofreces..  Reemplaza esta imagen con una más apropiada para tu empresa.</p><!-- /wp:paragraph --></div></div><!-- /wp:media-text --><!-- wp:spacer {\"height\":43} --><div class=\"wp-block-spacer\" style=\"height:43px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaType\":\"image\",\"mediaWidth\":43,\"isStackedOnMobile\":true} --><div class=\"alignwide is-stacked-on-mobile wp-block-media-text has-media-on-the-right\" style=\"grid-template-columns:auto 43%\"><figure class=\"wp-block-media-text__media\"><img alt=\"\" src=\"http://times.com.ar/times/wp-content/uploads/2019/08/services-2.jpg\"></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":3} --><h3>Habla más acerca de tus productos aquí.</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Aquí puedes contarles a los potenciales clientes más sobre tu empresa, y sobre los servicios que ofreces..  Reemplaza esta imagen con una más apropiada para tu empresa.</p><!-- /wp:paragraph --></div></div><!-- /wp:media-text --><!-- wp:spacer {\"height\":27} --><div class=\"wp-block-spacer\" style=\"height:27px\" aria-hidden=\"true\"></div><!-- /wp:spacer --><!-- wp:heading {\"level\":3} --><h3>Siguientes pasos...</h3><!-- /wp:heading --><!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} --><div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph --><p>Esta debe ser la llamada de acción número uno de un potencial cliente, por ejemplo, solicitar una cotización o analizar el catálogo de tus productos.</p><!-- /wp:paragraph --></div></div><!-- /wp:coblocks/column --><!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} --><div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:button {\"align\":\"center\"} --><div class=\"wp-block-button aligncenter\"><a href=\"/comunicate-con-nosotros/\" class=\"wp-block-button__link\">Llamada a la acción</a></div><!-- /wp:button --></div></div><!-- /wp:coblocks/column --></div></div><!-- /wp:coblocks/row -->', 'Servicios', '', 'inherit', 'closed', 'closed', '', '158-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 158, 'http://times.com.ar/times/158-revision-v1/', 0, 'revision', '', 0),
