(326, 1, '2019-08-28 17:34:27', '2019-08-28 20:34:27', '<!-- wp:paragraph --><p>Aquí es donde debes responder a las preguntas más comunes que los clientes potenciales pudieran tener. Es una buena idea abarcar cosas como tu política de devoluciones, información sobre la garantía del producto, envíos y devoluciones, etc. Consulta los ejemplos que aparecen a continuación.</p><!-- /wp:paragraph --><!-- wp:coblocks/dynamic-separator {\"className\":\"is-style-fullwidth\"} --><hr class=\"is-style-fullwidth wp-block-coblocks-dynamic-separator\" style=\"height:50px\"><!-- /wp:coblocks/dynamic-separator --><!-- wp:heading {\"level\":3} --><h3>¿Cuál es su política de devoluciones?</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Devuelve cualquiera de nuestros productos--sin inconveniente alguno--dentro de los 30 días de haberlo adquirido. Incluso pagamos el envío de retorno.</p><!-- /wp:paragraph --><!-- wp:coblocks/dynamic-separator {\"className\":\"is-style-fullwidth\"} --><hr class=\"is-style-fullwidth wp-block-coblocks-dynamic-separator\" style=\"height:50px\"><!-- /wp:coblocks/dynamic-separator --><!-- wp:heading {\"level\":3} --><h3>¿Hacen envíos al exterior y a casillas de correo?</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Sí, enviaremos tu paquete a cualquier lugar que pueda aceptar entregas.</p><!-- /wp:paragraph --><!-- wp:coblocks/dynamic-separator {\"className\":\"is-style-fullwidth\"} --><hr class=\"is-style-fullwidth wp-block-coblocks-dynamic-separator\" style=\"height:50px\"><!-- /wp:coblocks/dynamic-separator --><!-- wp:heading {\"level\":3} --><h3>¿Tienen un servicio de atención al cliente?</h3><!-- /wp:heading --><!-- wp:paragraph --><p>¡Por supuesto! Nuestros representantes de servicio de atención al cliente, amables y expertos, están disponibles para responder tus preguntas las 24 horas del día, los 7 días de la semana, los 365 días del año.</p><!-- /wp:paragraph -->', 'Preguntas frecuentes', '', 'inherit', 'closed', 'closed', '', '235-revision-v1', '', '', '2019-08-28 17:34:27', '2019-08-28 20:34:27', '', 235, 'http://times.com.ar/times/235-revision-v1/', 0, 'revision', '', 0),
