(372, 1, '2019-09-11 17:29:46', '2019-09-11 20:29:46', '<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55141317562\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55141317562\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"60.00\",\"coblocks\":{\"id\":\"55141320246\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55141320246\" style=\"width:60.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:gallery {\"ids\":[\"368\"]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/09/4804659.jpg\" alt=\"\" data-id=\"368\" data-link=\"http://times.com.ar/times/la-empresa/4804659-2/\" class=\"wp-image-368\"/></figure></li></ul>\n<!-- /wp:gallery --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"39.00\",\"coblocks\":{\"id\":\"55141320249\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55141320249\" style=\"width:39.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":3} -->\n<h3>Nuestra Filosofía</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Somos una empresa que se caracteriza por estar siempre al lado del cliente, asesorandolo y guiandolo para encontrar el producto que mejor se adapte a su necesidad, realizando los ajustes que él requiera en el momento que lo necesite</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Nuestra historia</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Desde 1992 estamos en la ciudad de Campana, siendo siempre innovadores, empezamos como centro de capacitación en las herramientas que aun pocos conocían como Windows, Word, Excel, y fuimos creciendo involucrandonos cada vez mas en las herramientas que las empresas necesitaban, por tal motivo armamos un pool de programadores siempre de la zona, todos estudiantes de la UTN, con quien establecimos contratos de pasantias y seguimos avanzando en este mundo maravilloso que nos permite crear aplicaciones  y que como todos sabemos no tiene limites.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:spacer {\"height\":63} -->\n<div style=\"height:63px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"center\"} -->\n<h3 style=\"text-align:center\">Conoce al equipo</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Escribe algo acerca de las personas que hacen funcionar tu empresa o sobre tu filosofía de servicio al cliente.\n¿Por qué? Porque la gente quiere saber con quiénes están haciendo sus negocios. Es una característica muy humana.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"columns\":3} -->\n<div class=\"wp-block-columns has-3-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-1.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"center\"} -->\n<h3 style=\"text-align:center\">Regan McCook</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em>Fundador y director ejecutivo</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-2.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"center\"} -->\n<h3 style=\"text-align:center\">Eric Teagan</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em>Vicepresidente</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/about-us-headshot-3.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"center\"} -->\n<h3 style=\"text-align:center\">Timothy Barrett</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em>Director financiero</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Incluye una breve biografía con datos interesantes acerca de la persona.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":27} -->\n<div style=\"height:27px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Siguientes pasos...</h3>\n<!-- /wp:heading -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-77124051