(440, 1, '2019-10-10 18:04:59', '2019-10-10 21:04:59', '<!-- wp:paragraph -->\n<p>Te presentamos algunos de nuestros productos, tene en cuenta que estos son desarrollos a medida que fueron armados segun la necesidad de cada cliente. Consultanos por adapataciones de los mismos para tu negocio, empresa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"10.00\",\"marginTop\":\"\",\"marginRight\":0,\"marginBottom\":\"\",\"marginLeft\":0,\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:10.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"98.05\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:98.05%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4,\"customTextColor\":null} -->\n<h4> Control de Facturacion </h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\n\nEsta Plataforma en la nube permite emitir y controlar la facturacion de los diferentes circulos medicos, odontologicos, clinicas, obras sociales\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Permite la carga de las distintas practicas y posterior proceso de facturacion a las diversas obras sociales, generando liquidaciones y retenciones de IIBB, GCias, etc que asi sea requerida.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"10.00\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:10.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"89.00\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:89.00%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4} -->\n<h4>Control de Viajes </h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Permite a traves de una plataforma agil y dinamica la solicitud de viajes para empresas, totalmente autogestionado. Emite los voucher de cada pedido para su posterior procesamiento, generando reportes de seguimiento para su facturacion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Controla la documentacion de los vehiculos y choferes y emite los reportes de los diferentes vencimientos de las polizas, vtv, control de matafuegos, etc.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"11.92\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:11.92%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"87.08\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:87.08%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4} -->\n<h4>Control Documentario</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Esta Plataforma en la nube permite controlar la documentacion de toda empresa contratista debe presentar mensualmente a grandes empresas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Realiza el seguimiento de documentacion entregada y faltante, pagos de 931, planes de facilidades de pago.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"11.19\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:11.19%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"87.81\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:87.81%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4} -->\n<h4>Control de Stock e Inventario</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Esta Plataforma, en la nube, permite realizar el relevamiento de datos a traves de una app android con codigo QR y posteriormente emitir los listados de stock de los productos</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Emite reportes de cada producto con su ubicacion respectiva</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Consultanos!!</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->', 'Catalogo de Productos', '', 'inherit', 'closed', 'closed', '', '160-revision-v1', '', '', '2019-10-10 18:04:59', '2019-10-10 21:04:59', '', 160, 'http://times.com.ar/times/160-revision-v1/', 0, 'revision', '', 0),
