(397, 1, '2019-09-13 16:58:33', '2019-09-13 19:58:33', '<!-- wp:paragraph -->\n<p>Te presentamos algunos de nuestros productos, tene en cuenta que estos son desarrollos a medida que fueron armados segun la necesidad de cada cliente. Consultanos por adapataciones de los mismos para tu negocio, empresa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:coblocks/gallery-masonry {\"align\":\"center\"} -->\n<div class=\"wp-block-coblocks-gallery-masonry\"><div class=\"coblocks-gallery has-caption-style-dark has-gutter\"><ul class=\"has-grid-xlrg has-gutter-15 has-gutter-mobile-15\"><li class=\"coblocks-gallery--item\"><figure class=\"coblocks-gallery--figure\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/09/coc2-1024x576.jpg\" alt=\"\" data-id=\"392\" data-link=\"http://times.com.ar/times/portafolio/coc2/\" class=\"wp-image-392\"/></figure></li><li class=\"coblocks-gallery--item\"><figure class=\"coblocks-gallery--figure\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/09/coc1-1-1024x576.jpg\" alt=\"\" data-id=\"395\" data-link=\"http://times.com.ar/times/portafolio/coc1-1/\" class=\"wp-image-395\"/></figure></li></ul></div></div>\n<!-- /wp:coblocks/gallery-masonry --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4} -->\n<h4>Seguimiento de Facturacion de Circulo Odontologico</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Esta Plataforma en la nube permite emitir y controlar la facturacion de los circulos odontologicos</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Permite la carga de las practicas odontologicas y posterior proceso de facturacion a las diversas obras sociales, generando liquidaciones y retenciones de IIBB, GCias, etc que asi sea requerida.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Consultanos!!</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:gallery {\"ids\":[390]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/09/condoc-1-1024x576.jpg\" alt=\"\" data-id=\"390\" data-link=\"http://times.com.ar/times/portafolio/condoc-1/\" class=\"wp-image-390\"/></figure></li></ul>\n<!-- /wp:gallery --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"55144357520\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357520\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:heading {\"level\":4} -->\n<h4>Control Documentario</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Esta Plataforma en la nube permite controlar la documentacion de toda empresa contratista debe presentar mensualmente a grandes empresas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Realiza el seguimiento de documentacion entregada y faltante, pagos de 931, planes de facilidades de pago.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Consultanos!!</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"55144348395\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-55144348395\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"55144357517\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-55144357517\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:coblocks/gallery-carousel {\"gutter\":0,\"gutterMobile\":0,\"gridSize\":\"xlrg\"} -->\n<div class=\"wp-block-coblocks-gallery-carousel\"><div class=\"is-cropped coblocks-gallery has-no-alignment has-caption-style-dark\"><div class=\"has-carousel has-carousel-xlrg\" style=\"height:400px\" data-flickity=\"{&quot;autoPlay&quot;:false,&quot;draggable&quot;:true,&quot;pageDots&quot;:false,&quot;prevNextButtons&quot;:true,&quot;wrapAround&quot;:true,&quot;arrowShape&quot;:{&quot;x0&quot;:10,&quot;x1&quot;:60,&quot;y1&quot;:50,&quot;x2&quot;:65,&quot;y2&quot;:45,&quot;x3&quot;:20}}\"><div class=\"coblocks-gallery--item\"><figure class=\"coblocks-gallery--figure\"><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/portfolio-2a.jpg\" alt=\"\" data-link=\"http://times.com.ar/times/?attachment_id=143\"/></figure></div><div class=\"coblo