(523, 1, '2019-10-11 16:22:40', '2019-10-11 19:22:40', '<!-- wp:columns {\"columns\":3,\"className\":\"is-services\"} -->\n<div class=\"wp-block-columns has-3-columns is-services\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:gallery {\"ids\":[331]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/EL_FRENTE_02018009007018030044_FOTO_2_NOTA_2-1.jpg\" alt=\"\" data-id=\"331\" data-link=\"http://times.com.ar/times/inicio/el_frente_02018009007018030044_foto_2_nota_2-1/\" class=\"wp-image-331\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><a href=\"#\">Asesoramiento</a></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Escuchamos las necesidades de nuestros clientes y los asesoramos en cuanto a la performance que necesitan</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:gallery {\"ids\":[332]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/internet_redes_sociais_816882180.jpg\" alt=\"\" data-id=\"332\" data-link=\"http://times.com.ar/times/inicio/internet_redes_sociais_816882180/\" class=\"wp-image-332\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><a href=\"#\">Desarrollo de Aplicaciones</a></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Diseñamos y realizamos aplicaciones agiles e intuitivas </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:gallery {\"ids\":[522]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/10/servicio-tecnico.png\" alt=\"\" data-id=\"522\" data-link=\"http://times.com.ar/times/inicio/servicio-tecnico/\" class=\"wp-image-522\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><a href=\"#\">Servicio Tecnico</a></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Realizamos el mantenimiento preventivo de los equipos y realizamos instalaciones de redes</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"className\":\"is-main-message\"} -->\n<div class=\"wp-block-columns has-2-columns is-main-message\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3} -->\n<h3>Trayectoria y Compromiso</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Contamos con mas de 25 años de trayectoria en el mercado de consultoria y desarollo de sistema.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nuestro compromiso es brindarle a nuestros clientes lo que ellos verdaderamente necesitan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para lograrlo trabajamos en equipo, ya que entendemos que el verdadero exito en el resultado se debe al trabajo en equipo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Acompañamos a los clientes durante el proceso de migracion  de plataforma, minimizando de este modo, la resistencia al cambio que genera todo nuevo sistema de trabajo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:gallery {\"ids\":[336]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://times.com.ar/times/wp-content/uploads/2019/08/4804659.jpg\" alt=\"\" data-id=\"336\" data-link=\"http://times.com.ar/times/inicio/attachment/4804659/\" class=\"wp-image-336\"/></figure></li></ul>\n<!-- /wp:gallery --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":27} -->\n<div style=\"height:27px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Comunicate con nosotros</h3>\n<!-- /wp:heading -->\n\n<!-- wp:coblocks/row {\"columns\":2,\"layout\":\"66-33\",\"coblocks\":{\"id\":\"77123959945\"}} -->\n<div class=\"wp-block-coblocks-row coblocks-row-77123959945\" data-columns=\"2\" data-layout=\"66-33\"><div class=\"wp-block-coblocks-row__inner has-medium-gutter has-no-padding has-no-margin is-stacked-on-mobile\"><!-- wp:coblocks/column {\"width\":\"66\",\"coblocks\":{\"id\":\"771240515\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240515\" style=\"width:66%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"><!-- wp:contact-widgets/contact-block {\"displayLabels\":false} -->\n<div class=\"wp-block-contact-widgets-contact-block\"><ul class=\"fields\"><li class=\"no-label\"><div><div class=\"contact-email\"><a href=\"mailto:times@times.com.ar\">times@times.com.ar</a></div></div></li><li class=\"no-label\"><div><div class=\"contact-phone\">3489422076</div></div></li><li class=\"no-label\"><div><div class=\"contact-address\">9 de Julio 991 - Campana</div><div class=\"has-map\"><iframe frameborder=\"0\" style=\"width:100%;min-height:205px\" src=\"https://www.google.com/maps?q=9%20de%20Julio%20991%20-%20Campana&amp;output=embed&amp;hl=%s&amp;z=14\"></iframe></div></div></li></ul></div>\n<!-- /wp:contact-widgets/contact-block --></div></div>\n<!-- /wp:coblocks/column -->\n\n<!-- wp:coblocks/column {\"width\":\"33\",\"coblocks\":{\"id\":\"771240519\"}} -->\n<div class=\"wp-block-coblocks-column coblocks-column-771240519\" style=\"width:33%\"><div class=\"wp-block-coblocks-column__inner has-no-padding has-no-margin\"></div></div>\n<!-- /wp:coblocks/column --></div></div>\n<!-- /wp:coblocks/row -->', 'Inicio', '', 'inherit', 'closed', 'closed', '', '156-revision-v1', '', '', '2019-10-11 16:22:40', '2019-10-11 19:22:40', '', 156, 'http://times.com.ar/times/156-revision-v1/', 0, 'revision', '', 0),
